import './NavButton.css';

/**
 * Represents a particular menu in navgation bar component.
 *
 * @component
 * @param {Object} props - The component props.
 * @param {string} props.id - The unique id for each menu.
 * @param {string} props.menu - The name of the menu.
 * @param {boolean} props.isActive - 
 * @param {React.FunctionComponent} props.handleClick - 
 * @returns {React.ReactElement} A user profile element.
 */

const NavButton = ({id, menu, isActive, handleClick}) => {
    return (
        <li className={'menu-item center ' + (isActive?'active':'')} key={id} onClick={handleClick}>{menu}</li>
    );
}

export default NavButton;
